import React from 'react';
import 'tachyons';
import img1 from './sharva1.png';
import img2 from './sharva2.png';
import img3 from './sharva3.png';
import img4 from './sharva1.png';

function Gallery() {
  const gal=[
    {
      image:img1,
      height:'450px',
      width:'450px'
    },
    {
      image:img2,
      height:'450px',
      width:'550px'
    }
  ]
    return (
        <section style={{overflow:'hidden'}}>

             <div className="flex flex-wrap mt4">
               <div className="ma3 ">
                 <a className="dim" href="https://www.amazon.com/BEYONCÉ-Beyonce/dp/B00KCOMBJC/ref=sr_1_2_twi_lp__3?s=music&ie=UTF8&qid=1480422067&sr=1-2&keywords=beyonce&tag=mrmrs01-20">
                 <img src={img1} height='450px' width='450px'/></a>
               </div>

               <div className="ma3">
                 <a className="dim" href="https://www.amazon.com/BEYONCÉ-Beyonce/dp/B00KCOMBJC/ref=sr_1_2_twi_lp__3?s=music&ie=UTF8&qid=1480422067&sr=1-2&keywords=beyonce&tag=mrmrs01-20">
                 <img src={img2} height='450px' width='550px'/></a>
               </div>

               <div className="ma3">
                 <a className="dim" href="https://www.amazon.com/BEYONCÉ-Beyonce/dp/B00KCOMBJC/ref=sr_1_2_twi_lp__3?s=music&ie=UTF8&qid=1480422067&sr=1-2&keywords=beyonce&tag=mrmrs01-20">
                 <img src={img3} height='650px' width='350px'/></a>
               </div>

               <div className="ma3">
                 <a className="dim" href="https://www.amazon.com/BEYONCÉ-Beyonce/dp/B00KCOMBJC/ref=sr_1_2_twi_lp__3?s=music&ie=UTF8&qid=1480422067&sr=1-2&keywords=beyonce&tag=mrmrs01-20">
                 <img src={img1} height='650px' width='650px'/></a>
               </div>

               <div className="ma3">
                 <a className="dim" href="https://www.amazon.com/BEYONCÉ-Beyonce/dp/B00KCOMBJC/ref=sr_1_2_twi_lp__3?s=music&ie=UTF8&qid=1480422067&sr=1-2&keywords=beyonce&tag=mrmrs01-20">
                 <img src={img2} height='400px' width='650px'/></a>
               </div>

               <div className="ma3">
                 <a className="dim" href="https://www.amazon.com/BEYONCÉ-Beyonce/dp/B00KCOMBJC/ref=sr_1_2_twi_lp__3?s=music&ie=UTF8&qid=1480422067&sr=1-2&keywords=beyonce&tag=mrmrs01-20">
                 <img src={img3} height='400px' width='350px'/></a>
               </div>

               <div>
                  gal.map((data)=>{
                    <div>
                      <img src={data.image} height={data.height} width={data.width}/>
                    </div>
                  })
               </div>

              </div>

      </section>
      );
}

export default Gallery;

